import './ProjectCard.scss';

const ProjectCard = ({ name, tech, description, imgUrl }) => {
  return (
    <div className="project-card">
      <div className="project-img">
      <div className="project-text">
        <h3>{name}</h3>
        <h4>{tech}</h4>
          <p>{description}</p>
        </div>
        </div>
    </div>
  );
};

export default ProjectCard;
